import React from 'react'
import { Link, Switch, Route } from 'react-router-dom';

export default function Launcher() {
    return (
        <Switch>
            <Route path="/" exact component={MainContent} />
            <Route path="/home" exact component={MainContent} />
        </Switch>
    )
}
